■商品名<br />シューイズム SHOEISM 本革 本革底 グッドイヤーウエルト製法 メダリオン ストレートチップ メンズシューズ<br /><br />■商品番号<br />du300<br /><br />■商品コメント<br />高品質な本革レザーを使用し<br /><br />グッドイヤーウェルト製法のレースアップシューズ<br /><br />吸湿性が高く、足馴染みの良いレザーソールは<br /><br />履き心地の良く仕上がっています。<br /><br />定番のシンプルなデザインにトラッドなフォルムは<br /><br />ビジネスやフォーマルなシーンを始め<br /><br />デニムなどカジュアルスタイルにもおすすめ<br /><br />履き込むほどに足に馴染み、質実剛健に頑丈な作りの<br /><br />グッドイヤーウェルト製法で末永く愛用できるシューズです。 <br /><br />■サイズ<br />【6/24.5cm】【6.5/25.0cm】【7/25.5cm】【7.5/26.0cm】【8/26.5cm】【8.5/27.0cm】【9/27.5cm】<br /><br />■ヒール高<br />約3.0cm<br /><br />■ワイズ<br />表記なし(E相当)<br /><br />■生産国<br />ベトナム<br /><br />■素材<br />天然皮革・本革底<br /><br /><font>当店取扱いサイズ<br /> <br />当店取扱いカラー<br /><br />店舗概要<br />シューズショップアキリコ akiriko 神戸の靴店は、婦人 紳士 ジュニア キッズ シューズ 通販 オンラインショップ です。<br />神戸から全国へお求めやすい価格で人気の レディースシューズを出来るだけ早い発送でお届け。<br />(婦人靴のお店 レディースシューズ レディース靴)(紳士靴のお店 メンズシューズ メンズ靴)レディース(女性靴 女性用 婦人用) メンズ(男性靴 男性用 婦人用)アパレル ファッション 通販 サイト です。<br /><br />シューイズム SHOEISM 本革 グッドイヤーウエルト製法 メダリオン ストレートチップ シューズ メンズ</font><BR><BR><img src="http://image.rakuten.co.jp/shoes-akiriko/cabinet/04886359/04889617/ashi-size.gif" width="400"><br> <img src="http://image.rakuten.co.jp/shoes-akiriko/cabinet/04886359/04889617/caution.gif"><style type="text/css">
