<table id="category">
<tr>
<td>

<img src="http://image.rakuten.co.jp/akiriko/cabinet/03448146/03448224/img60090556.gif" alt="ぺたんこ" />

<p>
<strong>フラットソール特集</strong>
<br />
らくちんペタンコは一度履いたらやみつきに!<br />
キラキラかわいいバレエからアウトドアにも◎なフラットシューズまで。<br />
デイリーにはもちろん色々な場面で大活躍間違いなしの、アキリコおすすめのフラットシューズ特集です。
</p>
</td>
<td>

<img src="http://image.rakuten.co.jp/akiriko/cabinet/03448146/03448224/img60090555.gif" alt="エンジニア" />

<p>
<strong>エンジニアブーツ特集</strong>
<br />
エンジニアブーツは、本来男性用のワーク系ブーツ。それをあえて女性らしいスタイルで合わせたりボトムインしてマニッシュにキメても◎<br />
定番デザインのエンジニアブーツからトレンドものまで。デザイン豊富にご用意しました！
</p>
</td>
</tr>
<tr>
<td>

<img src="http://image.rakuten.co.jp/akiriko/cabinet/03448146/03448224/img60090557.gif" alt="レザー" />

<p>
<strong>レザー特集</strong>
<br />
いい物は長く使いたい。履くほどに自分色に馴染んでゆく。<br />
本物思考のあなたに、とっておきの一足を見つけてください。<br />
サンダルからブーツまで、はじめての人にも手の届きやすいお値段から用意しています◎
</p>
</td>
<td>

<img src="http://image.rakuten.co.jp/akiriko/cabinet/03448146/03448224/img60090552.gif" alt="クラッシック" />

<p>
<strong>クラッシックローファー特集 </strong>
<br />
足に心地よくて、みんなが履きやすいトラッドシューズ。正統派デザインできちんとしたイメージを与え、履きやすく丈夫で長持ち。 デイリーな通学はもちろん、冠婚葬祭にもおすすめです。
</p>
</td>
</tr>
<tr>
<td>

<img src="http://image.rakuten.co.jp/akiriko/cabinet/03448146/03448224/img60090558.gif" alt="ショートブーツ" />

<p>
<strong>ショートブーツ特集</strong>
<br />
ガーリーにも甘辛にも合わせやすい使い回し便利なショートブーツ特集。<br />
パンツをブーツインしてマニッシュにも、スカートに合わせてガーリーにも<br />
プチプラでお洒落なショートブーツやブーティを集めました。
</p>
</td>
<td>

<img src="http://image.rakuten.co.jp/akiriko/cabinet/03448146/03448224/img60090553.gif" alt="ぺたんこ" />

<p>
<strong>コンフォートシューズ特集</strong>
<br />
足の悩みをかかえているけど、「コンフォートシューズはデザインがイマイチ。」なんて考えている方オススメ☆<br />
足に負担を掛けずにお洒落できちゃう、足の事を考えて作られた足に優しい靴スタイリッシュで履き心地バツグンの靴。
</p>
</td>
</tr>
</table>

